 import { color } from "@mui/material/node_modules/@mui/system"
import circle from "../assets/images/Group 243.png"



export const Hero=()=>{
     const style={
         position:'absolute',
         left:800,
         zIndex:1,
         top:-200,
         overflow:'hidden',
         height:'1000px',
         width:'1000em'
         
     }
    return(
        <>
         <div sx={{ overflow: 'hidden' }}>
          <img sx={{overflow:'hidden',position:'absolute',zIndex: 'tooltip'}} style={style}   src={circle} alt="circle" />
        
         </div>
            
        </>
    )
}
